import './App.css';
import Homepage from './pages/homepage/homepage.component';
import {Route, Routes, BrowserRouter} from 'react-router-dom'

function Home(){
  return <h1>Homepage</h1>;
}

function App() {
  return (
    <div>
    <Homepage />
    <BrowserRouter>
    <Routes>
    <Route path="/" element={<Home/>}/>
    </Routes>
    </BrowserRouter>
    </div>
  )
}

export default App;
